import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

const dummyData = [
  { title: "Naresh", notes: "i am not good boy", expand: true },
  { title: "Naveen", notes: "i am not good boy", expand: true },
  { title: "Dikson", notes: "i am not good boy", expand: false },
]

class App extends Component {
  render() {
    return (
      <div>
        <div className="d-flex p-3 bg-secondary text-white m-2">  
          <button type="button" className="btn btn-primary btn-sm">Add New Note</button>
        </div>
        <div class="row">
          <div class="col-25">
            <label for="subject">Subject</label>
          </div>
          <div class="col-75">
            <textarea id="subject" name="subject" placeholder="Write something.." style="height:200px"></textarea>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
